import React, { Component } from 'react'
import './../../styles/login.css';

import Logo from './../../assets/images/gredu-complete.svg'

class Login extends Component {
    render() {
        return (
            <div className="login">
                <div className="row col-12 box">
                    <div className="left-content col-6">
                        <img src={Logo} alt=""></img>
                        <br /><br />
                        <h3>Web Teacher</h3>
                    </div>
                    <div className="right-content col-6">
                        <p>Masuk ke akun Gredu kamu</p>
                        <br/>
                        <input type="text" placeholder="Alamat Email"></input>
                        <br/>
                        <input type="text" placeholder="Kata Sandi"></input>
                    </div>
                </div>
            </div>
        )
    }
}
export default Login;
